      <Link to="/inbox"><button className='button1'>inbox</button></Link>

      <Link to="/compose"><button className='button1'>compose</button></Link>

      <Link to="/sent"><button className='button1'>Sent</button></Link>



      </div>

    </div>

    <Routes>

      <Route path="/contacts" element={<Contacts/>}/>

      <Route path="/inbox" element={<Inbox/>}/>

